  false,\n\t\"url\": null,\n\t\"notes\": \"Information on CWT salmonids throughout
  the Pacific region is available in an on-line coastwide database, the Regional Mark
  Information System (RMIS). This database (see http://www.psmfc.org/rmpc/index.html
  ) is maintained by the Regional Mark Processing Center (RMPC) of the Pacific States
  Marine Fisheries Commission (PSMFC) to facilitate exchange of CWT data between release
  agencies, sampling/recovery agencies, and other data users.  NOAA Fisheries at Auke
  Bay Laboratories (ABL) is responsible for maintaining several different components
  of this coastwide CWT database including a complete list of release records for
  CWT salmonids released from Federally-funded research programs in Alaska.\",\n\t\"owner_org\":
